var {atan2,sqrt,sin,cos,PI,acos} = Math;

function project3D(x,y,z,vars){
	
	x-=vars.camX,y-=vars.camY,z-=vars.camZ;
	p=atan2(x,z),d=sqrt(z*z+x*x),x=sin(p-vars.yaw)*d,z=cos(p-vars.yaw)*d;
	p=atan2(y,z),d=sqrt(y*y+z*z),y=sin(p-vars.pitch)*d,z=cos(p-vars.pitch)*d;
	return {x:vars.cx+x/z*vars.scale,y:vars.cy+y/z*vars.scale,d:z>0?sqrt(x*x+y*y+z*z):-1};
}


elevation=(x,y,z)=>acos(z / sqrt(x*x+y*y+z*z));


function rgb(col){
  var r = ((0.33+Math.sin(col)*.33)*255)|0;
  var g = ((0.25+Math.cos(col)*.25)*255)|0;
  var b = ((0.33-Math.sin(col)*.33)*255)|0;
  return "#"+("0" + r.toString(16) ).slice (-2)+("0" + g.toString(16) ).slice (-2)+("0" + b.toString(16) ).slice (-2);
}


function reverseRasterize(depth, vars){

	var vert=new Vert(),d,p;
	vert.x=vars.camX+(-vars.cx+vars.mx)/vars.scale*depth;
	vert.y=vars.camY+(-vars.cy+vars.my)/vars.scale*depth;
	vert.z=vars.camZ+depth;    
	d=Math.sqrt((vert.y-vars.camY)*(vert.y-vars.camY)+(vert.z-vars.camZ)*(vert.z-vars.camZ));
	p=Math.atan2(vert.y-vars.camY,vert.z-vars.camZ);
	vert.y=vars.camY+Math.sin(p+vars.pitch)*d;
	vert.z=vars.camZ+Math.cos(p+vars.pitch)*d;
	d=Math.sqrt((vert.x-vars.camX)*(vert.x-vars.camX)+(vert.z-vars.camZ)*(vert.z-vars.camZ));
	p=Math.atan2(vert.x-vars.camX,vert.z-vars.camZ);
	vert.x=vars.camX+Math.sin(p+vars.yaw)*d;
	vert.z=vars.camZ+Math.cos(p+vars.yaw)*d;

	d=Math.sqrt((vert.x-vars.camX)*(vert.x-vars.camX)+
				(vert.y-vars.camY)*(vert.y-vars.camY)+
				(vert.z-vars.camZ)*(vert.z-vars.camZ));
	var x = vert.x-vars.camX;
	var y = vert.y-vars.camY;
	var z = vert.z-vars.camZ;
	var t=d/depth;
	vert.x=vars.camX+x/t;
	vert.y=vars.camY+y/t;
	vert.z=vars.camZ+z/t;
	return vert;
}


function process(vars){
	
	switch(vars.stage){
		case 0:
			vars.camY+=vars.frameNo/800;
			vars.camZ-=vars.frameNo/800;
			break;
		case 1:
			vars.camX-=vars.t1/38;
			vars.camZ-=vars.t1/50;
			vars.t1++;
			break;
		case 2:
			vars.scale-=vars.t1/2000;
			vars.pitch-=.00185;
			vars.t1++;
			break;
		case 3:
			for(var i=0;i<4;++i)vars.wings[i].a=1;
			rotate(vars.wings[0],20,-200,0,0,sin(Math.PI*2/30*vars.t2)*.16,0);
			if(vars.t2>30){
				vars.stage++;
				vars.t1=0;
			}
			vars.scale-=4;
			vars.camZ+=4;
			p = atan2(vars.camX, vars.camZ);
			d = sqrt(vars.camX * vars.camX + vars.camZ * vars.camZ);
			t = 0;//cos(vars.t2 / 20) / 50;
			vars.camX = sin(p + t) * d;
			vars.camZ = cos(p + t) * d;
			vars.yaw = PI + p + t;
			vars.pitch = elevation(vars.camX, vars.camZ, vars.camY) - PI / 2;
			vars.t2++;
			break;
		case 4:
			for(var i=0;i<4;++i)vars.wings[i].a=1;
			rotate(vars.wings[2],20,-200,0,0,sin(Math.PI*2/20*vars.t1)*.26,0);
			rotate(vars.wings[1],-20,0,0,sin(Math.PI*2/20*vars.t1)*.06,0,0);
			if(vars.t1>20){
				vars.stage++;
				vars.t2=0;
			}
			vars.scale-=14;
			vars.camZ+=18;
			p = atan2(vars.camX, vars.camZ);
			d = sqrt(vars.camX * vars.camX + vars.camZ * vars.camZ);
			t = 0;//cos(vars.t2 / 20) / 50;
			vars.camX = sin(p + t) * d;
			vars.camZ = cos(p + t) * d;
			vars.yaw = PI + p + t;
			vars.pitch = elevation(vars.camX, vars.camZ, vars.camY) - PI / 2;
			vars.t1++;
			break;
		case 5:
			vars.camY += vars.t2/1;
			p = atan2(vars.camX, vars.camZ);
			d = sqrt(vars.camX * vars.camX + vars.camZ * vars.camZ);
			t = cos(vars.t2 / 20) / 50;
			vars.camX = sin(p + t) * d;
			vars.camZ = cos(p + t) * d;
			vars.yaw = PI + p + t;
			vars.pitch = elevation(vars.camX, vars.camZ, vars.camY) - PI / 2;
			if(vars.t2>50){
				vars.stage++;
				vars.t1=0;
			}
			vars.scale-=vars.t2/8;
			vars.camZ+=vars.t2/50;
			rotate(vars.wings[0],20,0,0,vars.t2/2600,0,0);
			rotate(vars.wings[1],20,0,0,vars.t2/2600,0,0);
			rotate(vars.wings[2],-20,0,0,-vars.t2/2600,0,0);
			rotate(vars.wings[3],-20,0,0,-vars.t2/2600,0,0);
			vars.t2++;
			break;
		case 6:
			vars.camY -= vars.t1/20;
			p = atan2(vars.camX, vars.camZ);
			d = sqrt(vars.camX * vars.camX + vars.camZ * vars.camZ);
			t = cos(vars.t1 / 20) / 30;
			vars.camX = sin(p + t) * d;
			vars.camZ = cos(p + t) * d;
			vars.yaw = PI + p + t;
			vars.pitch = elevation(vars.camX, vars.camZ, vars.camY) - PI / 2;
			rotate(vars.wings[1],20,-120,0,0,sin(vars.t1/2)/24,0);
			rotate(vars.wings[3],-20,-120,0,0,sin(vars.t1/2)/24,0);
			rotate(vars.wings[0],20,0,0,-cos(vars.t1/4)/6,0,0);
			rotate(vars.wings[1],20,0,0,-cos(vars.t1/4)/6,0,0);
			rotate(vars.wings[2],-20,0,0,cos(vars.t1/4)/6,0,0);
			rotate(vars.wings[3],-20,0,0,cos(vars.t1/4)/6,0,0);
			if(vars.t1>200){
				vars.stage++;
				vars.t2=0;
			}
			vars.t1++;
			break;
		case 7:
      vars.seed=0;
      vars.stage=0;
      vars.t1=vars.t2=0;

      vars.frameNo=0;
      vars.camX = 950;
      vars.camY = -10;
      vars.camZ = -2000;
      vars.yaw=0;
      vars.pitch=0;
      vars.scale=1200;
			break;
	}
}

function rand(vars){
	vars.seed+=.1234;
	return parseFloat('0.'+sin(vars.seed).toString().substr(6));
}


function frame(vars) {

	if(typeof vars?.canvas === 'undefined' || vars == undefined){
		var vars={};
		vars.canvas = document.querySelector("#c");
		vars.ctx = vars.canvas.getContext("2d");
		vars.canvas.style.height=vars.canvas.clientWidth/1.778645+"px";
		vars.canvas.width = 1366*1.5;
		vars.canvas.height = 768*1.5;
		window.addEventListener("resize", function(){
			vars.canvas.style.height=vars.canvas.clientWidth/1.778645+"px";
		}, true);
		vars.canvas.oncontextmenu = function (e) { e.preventDefault(); };
		vars.canvas.addEventListener("mousemove", function(e){
			var rect = vars.canvas.getBoundingClientRect();
			vars.omx=vars.mx;
			vars.omy=vars.my;
			vars.mx = (e.clientX-rect.left)/(rect.right-rect.left)*vars.canvas.width;
			vars.my = (e.clientY-rect.top)/(rect.bottom-rect.top)*vars.canvas.height;
		}, true);
		vars.canvas.addEventListener("mousedown", function(e){
			switch(e.which){
				case 1: vars.leftButton=1; break;
				case 3: vars.rightButton=1; break;
			}
		}, true);
		vars.canvas.addEventListener("mouseup", function(e){
			switch(e.which){
				case 1: vars.leftButton=0; break;
				case 3: vars.rightButton=0; break;
			}
		}, true);
		vars.canvas.addEventListener("mousewheel", function(e){
			var e = window.event || e; // old IE support
			vars.wheelDelta = Math.max(-1, Math.min(1, (e.wheelDelta/120 || -e.detail)));
		}, true);
		vars.canvas.addEventListener("touchstart", function(e){
			vars.leftButton=1;
			e.preventDefault();
			var rect = vars.canvas.getBoundingClientRect();
			vars.omx=vars.mx;
			vars.omy=vars.my;
			vars.mx = (e.changedTouches[0].pageX-rect.left)/(rect.right-rect.left)*vars.canvas.width;
			vars.my = (e.changedTouches[0].pageY-rect.top)/(rect.bottom-rect.top)*vars.canvas.height;
		}, true);
		vars.canvas.addEventListener("touchend", function(e){
			vars.leftButton=0;
		}, true);
		vars.canvas.addEventListener("touchmove", function(e){
			e.preventDefault();
			var rect = vars.canvas.getBoundingClientRect();
			vars.omx=vars.mx;
			vars.omy=vars.my;
			vars.mx = (e.changedTouches[0].pageX-rect.left)/(rect.right-rect.left)*vars.canvas.width;
			vars.my = (e.changedTouches[0].pageY-rect.top)/(rect.bottom-rect.top)*vars.canvas.height;
		}, true);
		
		vars.wheelDelta=0;
		vars.cx=vars.canvas.width/2;
		vars.cy=vars.canvas.height/2;
		vars.mx=vars.cx;
		vars.my=vars.cy;
		vars.seed=0;
		vars.stage=0;
		vars.t1=vars.t2=0;

		vars.frameNo=0;
		vars.camX = 950;
		vars.camY = -10;
		vars.camZ = -2000;
		vars.yaw=0;
		vars.pitch=0;
		vars.scale=1200;
		
		loadScene(vars);
	}

	vars.frameNo++;
	requestAnimationFrame(()=>{frame(vars)});
	
	process(vars);
	draw(vars);
}

rotate=(shape,ox,oy,oz,yaw,pitch,roll)=>{
	var x,y,z,p,d;
	for(var i=0;i<shape.length;++i){
		x=shape[i].x1-ox;
		y=shape[i].y1-oy;
		z=shape[i].z1-oz;
		p=atan2(y,z)+pitch;
		d=sqrt(y*y+z*z);
		y=sin(p)*d;
		z=cos(p)*d;
		p=atan2(x,z)+yaw;
		d=sqrt(x*x+z*z);
		x=sin(p)*d;
		z=cos(p)*d;
		p=atan2(x,y)+roll;
		d=sqrt(x*x+y*y);
		x=sin(p)*d;
		y=cos(p)*d;
		shape[i].x1=x+ox;
		shape[i].y1=y+oy;
		shape[i].z1=z+oz;
		x=shape[i].x2-ox;
		y=shape[i].y2-oy;
		z=shape[i].z2-oz;
		p=atan2(y,z)+pitch;
		d=sqrt(y*y+z*z);
		y=sin(p)*d;
		z=cos(p)*d;
		p=atan2(x,z)+yaw;
		d=sqrt(x*x+z*z);
		x=sin(p)*d;
		z=cos(p)*d;
		p=atan2(x,y)+roll;
		d=sqrt(x*x+y*y);
		x=sin(p)*d;
		y=cos(p)*d;
		shape[i].x2=x+ox;
		shape[i].y2=y+oy;
		shape[i].z2=z+oz;
	}
}


function shuffle(arr) {
  var currentIndex = arr.length, temporaryValue, randomIndex;
  while (0 !== currentIndex) {
    randomIndex = Math.floor(Math.random() * currentIndex);
    currentIndex -= 1;
    temporaryValue = arr[currentIndex];
    arr[currentIndex] = arr[randomIndex];
    arr[randomIndex] = temporaryValue;
  }
  return arr;
}
